import { MDBCard, MDBRating } from "mdbreact";
import React, { Component } from "react";

class StatisticsForProducts extends Component {
  state = {
    rates: [
      { category: "Taste", score: 5 },
      { category: "Smell", score: 4 },
    ],
  };
  render() {
    return (
      <MDBCard>
        {this.state.rates.map((rate) => {
          <div>
            <h1>{rate.category}</h1>
            <MDBRating value={rate.score}>{rate.score}</MDBRating>
          </div>;
        })}
      </MDBCard>
    );
  }
}

export default StatisticsForProducts;
